import { Card, Carousel } from 'flowbite-react';
import React from 'react';
import img from "../../resources/real-estate-6688945_640.jpg";
import img2 from "../../resources/logoOupia.svg"

const PostDetail = () => {
    return (
        <Card className="bg-Dark">
            <Carousel slideInterval={5000} className="h-1/2">
                <div className='w-full h-full'>
                    <img
                        alt="img"
                        src={img}
                    />
                </div>

                <div className='w-full h-full'>
                    <img
                        alt="img"
                        src={img2}
                    />
                </div>

                <div className='w-full h-full'>
                    <img
                        alt="img"
                        src={img}
                    />
                </div>

                <div className='w-full h-full'>
                    <img
                        alt="img"
                        src={img2}
                    />
                </div>

                <div className='w-full h-full'>
                    <img
                        alt="img"
                        src={img}
                    />
                </div>
            </Carousel>
        </Card>
    );
};

export default PostDetail;
